import React, { Component } from 'react';

class Practica09 extends Component{

state = {numero:0}

  render(){
    const {numero} = this.state;
    return(
        <div>
          Tabla del 2
          2*{numero} = {2*numero}
          <button onClick={()=>this.setState({numero: numero + 1})}>2*{numero}</button>
        </div>
      )
  }
}
export default Practica09;
